import Head from 'next/head';


function Navbar() {
  return (
    <div>

      <nav className="navbar">
        <div className="container">
          <a href="#">Hulk</a>
          <a href="#" class="logo is-active">Mavel</a>
          <a href="#">Venom</a>
        </div>
      </nav>
      <style jsx>{`
        .navbar {
          display:block;
          width: 100%;
          height: 8rem;
          background-color: #111;
          color: #ffffff;
          position: fixed;
          left: 0;
          top: 0;
          box-shadow: 0px 6px 8px rgba(0, 0, 0, 0.5);
        }

      `}
      </style>
    </div>
  )
}

export default Navbar
